import {
    REQUESTING_POKEMON_TYPE, 
    FAIL_REQUEST_POKEMON_TYPE,
    SUCCESS_REQUEST_POKEMON_TYPE } from '../constants/constants';
import axios from 'axios';


export const pokeTypeGet = ()=>(dispatch)=>{

    dispatch({type:  REQUESTING_POKEMON_TYPE })
    axios.get(`http://localhost:3001/pokemons/type`)
    .then(
        (resp)=>{ 
            dispatch({type:  SUCCESS_REQUEST_POKEMON_TYPE, payload: resp.data}) 
        },
        (err)=>{ 
            dispatch({type:  FAIL_REQUEST_POKEMON_TYPE , payload: err}) 
        }
    );
};
